script: |
  super -f text -I q3296.spq | sort > q3296.out

inputs:
  - name: q3296.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE NOT col1 * col0 - + col1 + - + col1 + - 47 - - col1 / + col0 IS NULL;
  - name: tab2

outputs:
  - name: q3296.out
    data: |
      46	51	23
      64	77	40
      75	67	58
